account_withdrawal_info:
- 脱退時、あなたのプロジェクト及びプロモーション情報などの全ての情報が削除されます。
{br}
- 有料プロジェクトに対する未払い額があった場合は脱退できません。
{br}
- あなたがの最上位管理者権限であった場合、最上位管理者としての権限を他のメンバーに譲るか、プロジェクトを削除してください。
{br}
- 脱退したアカウントは再利用と復旧ができなくなるので、慎重に進めてください。
{br}

